import React, { useState, useEffect } from 'react';
import './SellerInterface.css';
import logo from "../assets/images/BookTown.png";

const SellerInterface = () => {
  const [state, setState] = useState('Standard');
  const [bookDetails, setBookDetails] = useState({
    sellerName: localStorage.getItem('sellerName') || '', // Persist sellerName
    bookName: '',
    author: '',
    rentalPeriod: '',
    city: '',
    printRunNumber: '',
    paperbackType: '',
  });
  const [error, setError] = useState('');
  const [successMessage, setSuccessMessage] = useState('');

  useEffect(() => {
    const sellerName = localStorage.getItem('sellerName');
    if (sellerName) {
      setBookDetails((prevDetails) => ({
        ...prevDetails,
        sellerName,
      }));
    }
  }, []);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setBookDetails({ ...bookDetails, [name]: value });
  };

  ;  

  return (
    <div className="seller-interface">
      <nav className="navbar">
        <img src={logo} alt="Logo" className="logo" />

        <div className="nav-buttons">
          <button onClick={() => window.location.href = '/events'}>Upcoming Events</button>
          <button onClick={() => window.location.href = '/reviews'}>Reviews</button>
          <button onClick={() => window.location.href = '/'}>Home</button>
          <button onClick={() => window.location.href = '/'}>Logout</button>
        </div>
      </nav>

      <div className="form-container">
        <h2>Enter Book Details</h2>
        <form onSubmit={handleSubmit}>
          <label>
            Seller's Name:
            <input 
              type="text" 
              name="sellerName" 
              value={bookDetails.sellerName} 
              onChange={handleChange} 
              required 
            />
          </label>

          <label>
            Book Name:
            <input 
              type="text" 
              name="bookName" 
              value={bookDetails.bookName} 
              onChange={handleChange} 
              required 
            />
          </label>

          <label>
            Author:
            <input 
              type="text" 
              name="author" 
              value={bookDetails.author} 
              onChange={handleChange} 
              required 
            />
          </label>

          <label>
            Rental Period:
            <input 
              type="text" 
              name="rentalPeriod" 
              value={bookDetails.rentalPeriod} 
              onChange={handleChange} 
              required 
            />
          </label>

          <label>
            Seller's City:
            <input 
              type="text" 
              name="city" 
              value={bookDetails.city} 
              onChange={handleChange} 
              required 
            />
          </label>

          <label>
            State of the Book:
            <select 
              name="state" 
              value={state} 
              onChange={(e) => setState(e.target.value)}
            >
              <option value="Standard">Standard</option>
              <option value="Collectible">Collectible</option>
            </select>
          </label>

          {state === 'Collectible' && (
            <>
              <label>
                Print Run Number:
                <input 
                  type="text" 
                  name="printRunNumber" 
                  value={bookDetails.printRunNumber} 
                  onChange={handleChange} 
                  required 
                />
              </label>

              <label>
                Paperback Type:
                <input 
                  type="text" 
                  name="paperbackType" 
                  value={bookDetails.paperbackType} 
                  onChange={handleChange} 
                  required 
                />
              </label>
            </>
          )}

          {error && <p className="error-message">{error}</p>}
          {successMessage && <p className="success-message">{successMessage}</p>}

          <button type="submit">Submit</button>
        </form>
      </div>
    </div>
  );
};

export default SellerInterface;
